import React from "react";

const FullPokemonList = ({ pokemonData }) => {
  console.log(pokemonData);
  return (
    <>
      {pokemonData && pokemonData.length > 0 && (
        <div className="border">
          <div className="pokemon-card">
            {pokemonData[0].id}
            {pokemonData[0].name}
            <img src={pokemonData[0].sprites.front_default} alt="" />
          </div>
          <img src={pokemonData[0].item.sprites.front_default} alt="" />
          {/* <img src={pokemonData[0].item.sprites.back_default} alt="" /> */}/
          {/* {/* <h2 className="font-bold text-2xl">Types:</h2> */}
        <ul>
          {pokemonData.map((item, index) => (
            <div>
              <div className="border" key={index}>
                {item.name}
                {item.id}
                <img src={item.sprites.front_default} alt="" />
                <img src={item.sprites.back_default} alt="" />
              </div>
            </div>
          ))}
        </ul> */}
        </div>
      )}
    </>
  );
};

export default FullPokemonList;
